import React from 'react';
import Card from './Card';
// import {nbaPlayers} from './nbaPlayers';

const CardList = ({nbaPlayers}) => {

   const cardArray = nbaPlayers.map((val, ind) => {
      return (
         <Card
            rank={val[ind].rank}
            name={val[ind].name}
            team={val[ind].team}
         />);
   });

   return (<div>

      {cardArray}

   </div>);

}

export default CardList;
